<script>

function movingAverage(interval) {

var array = chartConfig.dataSets[0].dataProvider;

for (i = (interval - 1); i < array.length; i++) { 
	
	var array_slice = array.slice((i - interval), i);
	
	//console.log(array_slice);

	var total = 0;
		
	for (j = 0; j < array_slice.length; j++) { 
			
		total += Number(array_slice[j]['c']);
			
	}
				   
	array[i]["ma"] = Math.round((total / interval),3);
			
			
}
}

function exportChart()
	   {			
		
		chart.export.capture({},function() {
			this.toPNG({},function(data) {
				// Download the image to the browser
				this.download( data, "image/png", "macrotrends-stock-price-history-MS-2023-04-06.png" );

 $(document).ready(function(){
	 
	// Selects all of the text in the chart export window when clicked
	$(".modal_link").focus(function() {
		var $this = $(this);
		$this.select();

		// Work around Chrome's little problem
		$this.mouseup(function() {
			// Prevent further mouseup intervention
			$this.unbind("mouseup");
			return false;
		});
	});


	
	$(".dataExport").click( function() {
						
		window.parent.$('#smallWidthModal2').modal(); 
				
		window.parent.location.href = 'https://www.macrotrends.net/assets/php/stock_data_download.php?s=642f37576abd3&t=MS';
		
	});	
	 
	$(".imageExport").click( function() {
						
		window.parent.$('#smallWidthModal2').modal(); 
				
		exportChart();
		
	});


	$('#type_radio_box').change(function(){
		var c = $("input[name='type_radio']:checked").val();
		
		if(c == 'candlestick') {
			chart.panels[0].stockGraphs[0].type = 'candlestick';
			chart.panels[0].stockGraphs[0].precision = 3;
			chart.categoryAxesSettings.maxSeries = 700;
			chart.panels[0].stockGraphs[0].lineThickness = 1;
			chart.panels[0].stockGraphs[0].lineColor = "#555";
			chart.panels[0].stockGraphs[0].fillColors = "#009933";
			chart.panels[0].stockGraphs[0].negativeLineColor = "#555";
			chart.panels[0].stockGraphs[0].negativeFillColors = "#FF0000";
			chart.panels[0].stockGraphs[0].fillAlphas = 1;
			chart.panels[0].stockGraphs[0].balloonText = "<table style='font-size:13px;'><tr><td class='balloon_title'>O:</td><td>[[open]]</td></tr><tr><td class='balloon_title'>H:</td><td>[[high]]</td></tr><tr><td class='balloon_title'>L:</td><td>[[low]]</td></tr><tr><td class='balloon_title'>C:</td><td>[[close]]</td></tr></table>";
			chart.panelsSettings.recalculateToPercents = "never";
			chart.panelsSettings.marginRight = "55";
			$("#log_checkbox").checkbox('enable');
			$("#ma50_checkbox").checkbox('enable');
			$("#ma200_checkbox").checkbox('enable');
			
		} else if (c == 'ohlc') {
			chart.panels[0].stockGraphs[0].type = 'ohlc';
			chart.panels[0].stockGraphs[0].precision = 3;
			chart.categoryAxesSettings.maxSeries = 700;
			chart.panels[0].stockGraphs[0].lineThickness = 1;
			chart.panels[0].stockGraphs[0].lineColor = "#009933";
			chart.panels[0].stockGraphs[0].fillColors = "#009933";
			chart.panels[0].stockGraphs[0].negativeLineColor = "#FF0000";
			chart.panels[0].stockGraphs[0].negativeFillColors = "#FF0000";
			chart.panels[0].stockGraphs[0].fillAlphas = 0;
			chart.panels[0].stockGraphs[0].balloonText = "<table style='font-size:13px;'><tr><td class='balloon_title'>O:</td><td>[[open]]</td></tr><tr><td class='balloon_title'>H:</td><td>[[high]]</td></tr><tr><td class='balloon_title'>L:</td><td>[[low]]</td></tr><tr><td class='balloon_title'>C:</td><td>[[close]]</td></tr></table>";
			chart.panelsSettings.recalculateToPercents = "never";			
			chart.panelsSettings.marginRight = "55";
			$("#log_checkbox").checkbox('enable');
			$("#ma50_checkbox").checkbox('enable');
			$("#ma200_checkbox").checkbox('enable');
		}  else if (c == 'line') {
			chart.panels[0].stockGraphs[0].type = 'line';

			chart.panels[0].stockGraphs[0].lineColor = "#5B9BD5";
			chart.panels[0].stockGraphs[0].fillColors = "";
			chart.panels[0].stockGraphs[0].negativeLineColor = "#5B9BD5";
			chart.panels[0].stockGraphs[0].negativeFillColors = "";
			chart.panels[0].stockGraphs[0].fillAlphas = 0;
			chart.panels[0].stockGraphs[0].balloonText = "<table style='font-size:13px;'><tr><td>[[close]]</td></tr></table>";

			chart.panelsSettings.marginRight = "55";
			$("#log_checkbox").checkbox('enable');
			$("#ma50_checkbox").checkbox('enable');
			$("#ma200_checkbox").checkbox('enable');

			chart.panels[0].stockGraphs[0].type = 'line';

			chart.panels[0].stockGraphs[0].negativeFillColors = "";
			chart.panels[0].stockGraphs[0].fillAlphas = 0;
			chart.panels[0].stockGraphs[0].balloonText = "<table style='font-size:13px;'><tr><td>[[percents.close]]%</td></tr></table>";
			chart.panelsSettings.recalculateToPercents = "always";
			chart.panelsSettings.marginRight = "77";
			chart.valueAxesSettings.logarithmic = false;
			$("#log_checkbox").checkbox('uncheck').checkbox('disable');
			$("#ma50_checkbox").checkbox('uncheck').checkbox('disable');
			chart.panels[0].stockGraphs[1].hidden = true;
			$("#ma200_checkbox").checkbox('uncheck').checkbox('disable');
			chart.panels[0].stockGraphs[2].hidden = true;

		chart.validateNow();

	$('#ma_select_list').on('changed.fu.selectlist', function () {

		chart.panels[0].stockGraphs[1].hidden = false;
		chart.validateNow(); 
	});	

 $("#log_checkbox").change( function()
		   {
			var c = this.checked;
			
			if(c == true) {

				chart.valueAxesSettings.logarithmic = true;
				chart.valueAxesSettings.showFirstLabel = true;
				$("#radio_percent").attr('disabled',true);
